import React from 'react';
import { NavLink } from 'react-router-dom';
import './TabNav.css';

const TabNav = ({ activeTab, category, manufacturer, series, model }) => {
  return (
    <div className="tab-nav">
      <NavLink
        to="/"
        className={`tab-item ${activeTab === 'category' ? 'active' : ''}`}
        onClick={(e) => {
          if (activeTab !== 'category') e.preventDefault();
        }}
      >
        <div>Category</div>
        <div className="subtitle">{category}</div>
      </NavLink>
      <NavLink
        to={`/${category}`}
        className={`tab-item ${activeTab === 'manufacturer' ? 'active' : ''}`}
        onClick={(e) => {
          if (activeTab !== 'manufacturer') e.preventDefault();
        }}
      >
        <div>Manufacturer</div>
        <div className="subtitle">{manufacturer}</div>
      </NavLink>
      <NavLink
        to={`/${category}/${manufacturer}`}
        className={`tab-item ${activeTab === 'series' ? 'active' : ''}`}
        onClick={(e) => {
          if (activeTab !== 'series') e.preventDefault();
        }}
      >
        <div>Series</div>
        <div className="subtitle">{series}</div>
      </NavLink>
      <NavLink
        to={`/${category}/${manufacturer}/${series}`}
        className={`tab-item ${activeTab === 'model' ? 'active' : ''}`}
        onClick={(e) => {
          if (activeTab !== 'model') e.preventDefault();
        }}
      >
        <div>Model</div>
        <div className="subtitle">{model}</div>
      </NavLink>
      <div className={`tab-item ${activeTab === 'alternative' ? 'active' : ''}`}>
        <div>Alternative</div>
      </div>
    </div>
  );
};

export default TabNav;
